import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import { MAIN_ROUTE, POLLS_ROUTE, NEWS_ROUTE, FAMILY_ROUTE, POLICY_ROUTE, ANIMALS_ROUTE, ECOLOGY_ROUTE, CONTACTS_ROUTE, INFORMATION_ROUTE } from '../../const';
import logo from '../../img/logo-main.png';
import './Header.css';
import Modal from '../ModalReserve/Modal';
import ModalOrder from '../ModalOrder/ModalOrder';

const Header = () => {

    const [modalActive, setModalActive] = useState(false)
    const [modalOrderActive, setModalOrderActive] = useState(false)

    return (
        <div>
            <header>
                <li><NavLink to={MAIN_ROUTE}>
                    <img className="header-item" src={logo} alt="" />
                </NavLink></li>
                <div className="header">
                <nav className="secondarynav">
                    <NavLink to={POLLS_ROUTE}>Опросы</NavLink>
                    <NavLink to={NEWS_ROUTE}>Публикации</NavLink>
                    <li>
                        <NavLink to={FAMILY_ROUTE}>Фамилия</NavLink>
                        <NavLink to={POLICY_ROUTE}>Политика</NavLink>
                        <NavLink to={ANIMALS_ROUTE}>Животные</NavLink>
                        <NavLink to={ECOLOGY_ROUTE}>Экология</NavLink>
                    </li>
                    <NavLink to={CONTACTS_ROUTE}>Контакты</NavLink>
                    <NavLink to={INFORMATION_ROUTE}>Информация</NavLink>
                    <NavLink onClick={() => setModalOrderActive(true)}>Заказать онлайн</NavLink>
                    <button className='btnHeader' onClick={() => setModalActive(true)}>Забронировать место</button>
                </nav>
                </div>
            </header>
            <Modal active={modalActive} setActive={setModalActive} />
            <ModalOrder active={modalOrderActive} setActive={setModalOrderActive} />
        </div>
    );
};

export default Header;
